  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <h1>{productNmae}</h1>
          <p>{productDescription}</p>
          <a href=" ">Learn More &nbsp; </a>
        </div>
        <div className="col"></div>
      </div>
    </div>
  );
}

export default RightSection;
